import React, { useState } from 'react';
import './App.css';

function App() {
  const [loggedIn, setLoggedIn] = useState(false);
  const [userType, setUserType] = useState('');

  const handleLogin = (username, password, userType) => {
    // Aquí podrías implementar la lógica de autenticación
    // Por ahora, simplemente marcamos al usuario como autenticado
    setLoggedIn(true);
    setUserType(userType);
  };

  return (
    <div className="App">
      {!loggedIn ? (
        <LoginForm handleLogin={handleLogin} />
      ) : (
        <div>
          <h1>Bienvenido {userType === 'club' ? 'Club' : 'Seguidor'}</h1>
          {/* Aquí podrías mostrar el contenido correspondiente al tipo de usuario */}
        </div>
      )}
    </div>
  );
}

export default App;
